import React from 'react';
import Note from './Note';

const NoteList = ({ notes, setCurrentNote, filter }) => {
    const filteredNotes = notes.filter(note => note.category.includes(filter));

    return (
        <div className="note-list">
            {filteredNotes.map(note => (
                <Note key={note.id} note={note} setCurrentNote={setCurrentNote} />
            ))}
        </div>
    );
};

export default NoteList;
